odule.exports = {
  env: {
    browser: true,
    es2021: true,
  },
  global: {
    process: 'readonly',
  },
  extends: [
    'eslint:recommended',
    //"plugin:react/recommended"
    'plugin:vue/vue3-essential',
    'plugin:prettier/recommended',
  ],
  overrides: [
    {
      env: {
        node: true,
      },
      files: ['.eslintrc.{js,cjs}'],
      parserOptions: {
        sourceType: 'script',
      },
    },
  ],
  parserOptions: {
    ecmaVersion: 'latest',
    sourceType: 'module',
  },
  plugins: ['react'],
  rules: {},
}
